const Toolbar = (props) =>
{
    return (
        <div className="toolbar d-flex">
            <div className="row">
                <i className="fas fa-terminal col-xs-4"></i>
                <i className="col-xs-4">{props.title}</i>
                <i className={props.icon+" col-xs-4"} onClick={props.onClick}></i>
            </div>
        </div>
    );
}

export default Toolbar;
